import React, { useState } from "react";

import Plans from "./Booking/Plans";
import PersonalInfo from "./Booking/PersonalInfo";

const HomeBookingSection = () => {
  const [bookingView, setBookingView] = useState("ShowPlans");
  const [plan, setPlan] = useState("");
  const height = 0;

  const planClickHandler = (infoFromPlans) => {
    setBookingView("PersonalInfo");
    setPlan(infoFromPlans.planName);
    //Get height of container that is rendered from Plans.js and send it to other components so that same height is maintained for better UX
    height = infoFromPlans.height;
  };

  const getBookingView = () => {
    console.log("inside jsdj");
    switch (bookingView) {
      case "PersonalInfo":
        return <PersonalInfo height={height}/>;
      default:
        return <Plans onUserClickPlan={planClickHandler} />;
    }
  };
  return getBookingView();
};

export default HomeBookingSection;
